export default function (req, res) {
  if (req.method != "POST") {
    return res.status(405).end();
  }

  const {laaneBelop, nominellRente, terminGebyr, utlopsDato, saldoDato, datoForsteInnbetaling} = req.body

  res.end(laaneBelop, nominellRente, terminGebyr, utlopsDato, saldoDato, datoForsteInnbetaling)
}
